import React from 'react';
import classes from './Users.module.css'

let Users = (props) => {

    if (props.users.len)
    props.setUsers(
        [
        {id: 1, followed: false, fullName: 'Alex Ivanov', status: 'Boss', location: {country: 'Ukraine', city: 'Kiyv'}, imgSrc: 'data:image/jpeg;base64,'}, 
        {id: 2, followed: true, fullName: 'Olga Petrova', status: 'Student', location: {country: 'Ukraine', city: 'Dnepr'}, imgSrc: 'data:image/jpeg;base64,'}, 
        {id: 3, followed: false, fullName: 'Katya Sidorova', status: 'Hiii', location: {country: 'Poland', city: 'Krakow'}, imgSrc: 'data:image/jpeg;base64,'},
        ]
    );

    return (
        <div>
            {
                props.users.map( (user)=> {
                    return  (
                        <div key={user.id}>
                        <span>
                            <div>
                                <img  src={user.imgSrc}/>
                            </div>    
                            <div>
                                    {user.followed
                                        ? <button onClick={ () => props.unfollow(user.id)}>Unollow</button> 
                                        : <button onClick={ () => props.follow(user.id)}>Follow</button> 
                                    }
                            </div>
                        </span>
                        <span>
                            <span>
                                <div>{user.fullName}</div>
                                <div>{user.status}</div>
                            </span>
                            <span>
                                <div>{user.location.city}</div>
                                <div>{user.location.country}</div>
                            </span>

                        </span>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Users;
